class UserStory:
    def __init__(self, role, description):
        self.role = role
        self.description = description

    def __str__(self):
        return f"{self.role}: {self.description}"


class UserStoryManager:
    def __init__(self):
        self.user_stories = []

    def add_user_story(self, role, description):
        new_story = UserStory(role, description)
        self.user_stories.append(new_story)

    def filter_user_stories_by_role(self, role):
        return [story for story in self.user_stories if story.role == role]

    def display_all_user_stories(self):
        return [str(story) for story in self.user_stories]


class DesignUpdate:
    def __init__(self, update_description):
        self.update_description = update_description

    def __str__(self):
        return self.update_description


class DesignUpdateManager:
    def __init__(self):
        self.design_updates = []
        self.user_testing_schedule = []

    def add_design_update(self, update_description):
        new_update = DesignUpdate(update_description)
        self.design_updates.append(new_update)

    def schedule_user_testing(self, date):
        self.user_testing_schedule.append(date)

    def get_design_updates(self):
        return [str(update) for update in self.design_updates]


class ImprovementLog:
    def __init__(self):
        self.improvements = []

    def log_improvement(self, improvement_description):
        self.improvements.append(improvement_description)

    def get_improvements(self):
        return self.improvements


class DFileRequest:
    def __init__(self, request_description):
        self.request_description = request_description

    def __str__(self):
        return self.request_description


class DFileManager:
    def __init__(self):
        self.d_file_requests = []

    def add_d_file_request(self, request_description):
        new_request = DFileRequest(request_description)
        self.d_file_requests.append(new_request)

    def get_d_file_requests(self):
        return [str(request) for request in self.d_file_requests]


class FABSFileManager:
    def __init__(self):
        self.fabs_files = []

    def add_fabs_file(self, file_name):
        self.fabs_files.append(file_name)

    def get_fabs_files(self):
        return self.fabs_files


